- input: "TEXT\x1CC00233304\x1C.TEXT\x1C\x1CF3XA\x1CIn response to the letter I received
    on 09/24/10 referencing July Quarterly Report (4/1/10-6/30/10).  See amended filing
    and explaination below addressing the two items listed in the letter.                                                                                                                                                                                                                                    1.
    On Schedule A,  I went into each memo receipt and checked the aggregate box so
    that the YTD totals from individuals affiliated with a LLC or LP contribution
    are now included.                                                                                                                                                                                                                                                    2.
    \ On Schedule B,  regarding the disbursement to the Democratic Senat Campgn Comm.
    \ Demint for senate Committee was selected in error under the candidate/campaign
    committee field when entering the transaction on our original filing.  The candidate/campaign
    committee should be the same as the disbursement, in this case the Democratic
    Senate Campgn Comm.  I have made this correction.  Therefore, the contribution
    made to the Democratic Senat Campgn Comm exercises no direction or control over
    how the funds were to be used.\n"
